const Hero = () => {
	return (
		<div className='jumbotron'>
			<div className='container'>
				<div className='row'>
					<div className='col-sm'>
						<h1>Herzlich willkommen in unserer Praxis</h1>
					</div>
				</div>
			</div>
		</div>
	);
};

export default Hero;
